import SwiftUI
import SceneKit

struct ContentView: View {
    
    @State var startSimulation = false
    @State var currentQuaternionStrings = [String]()
    @State var startSim = false
    
    @State var allTransformsData = [CapturedData]()
    
    //let timer = Timer.publish(every: 20, on: .main, in: .common).autoconnect()
    
    var numberOfFiles = 25
    
    @State var currentFileLength: Int
    @State var currentIndexInFile: Int = 0
    
    var timer = Timer.publish(every: 0.01, on: .main, in: .common).autoconnect()
    
    init() {
        _currentFileLength = State(initialValue: 0)
        _allTransformsData = State(initialValue: createData())
        _currentFileLength = State(initialValue: allTransformsData.count)
    }
    
