    var body: some View {
        
        VStack{
            Divider()
            TPoseView(quaternionStrings: $currentQuaternionStrings)
                .frame(width: UIScreen.main.bounds.width, height: UIScreen.main.bounds.height * 0.5)
                .onReceive(timer) { _ in
                    
                    if startSim && currentIndexInFile < allTransformsData.count - 1{
                        currentIndexInFile += 1
                        currentQuaternionStrings = allTransformsData[currentIndexInFile].quaternionStrings
                    }
                    
                    
                    
                }
            
            Divider()
            
            
            Button{
                startSim.toggle()

            } label: {
                Text("Start")
            }
            .padding()
            
                
        }
    }
    
    func createData() -> [CapturedData] {
        
        let arr = [file1, file2, file3, file4, file5, file6, file7, file8, file9, file10, file11, file12, file13, file14, file15, file16, file17, file18, file19, file20, file21, file22, file23, file24, file25]
        
        
        var allTransformsData = [CapturedData]()
        
        for file in arr {
            let data: Data? = file.data(using: .utf8)
            //let json = (try? JSONSerialization.jsonObject(with: data!, options: .allowFragments)) as? [Dictionary<String,Any>]
            let decoder = JSONDecoder()
            if let decodedData = try? decoder.decode([CapturedData].self, from: data!) {
                
                allTransformsData.append(contentsOf: decodedData)
            }
            
        }
        
        
        return allTransformsData
    }
    
    
