struct TPoseView: UIViewRepresentable {
    
    typealias UIViewType = UIView
    
    let sceneView = SCNView()
    let scene = SCNScene(named: "TPoseMain.usdz")
    
    
    
    
    @Binding var quaternionStrings: [String]
    
    
    func makeUIView(context: Context) -> UIView {
        
        
        sceneView.scene = scene
        sceneView.allowsCameraControl = true
        sceneView.autoenablesDefaultLighting = true
        
        
        
        return sceneView
    }
    
    
    func updateUIView(_ uiView: UIView, context: Context) {
        
        let skeleton = scene?.rootNode.childNode(
            withName: "TPoseMain", recursively: true)
        
        
        let leftHandLower = skeleton?.childNode(withName: "mixamorig_LeftForeArm", recursively: true)
        
        let leftHandUpper = skeleton?.childNode(withName: "mixamorig_LeftArm", recursively: true)
        
        let rightHandLower = skeleton?.childNode(withName: "mixamorig_RightForeArm", recursively: true)
        
        let rightHandUpper = skeleton?.childNode(withName: "mixamorig_RightArm", recursively: true)
        
        let waist = skeleton?.childNode(withName: "mixamorig_Hips", recursively: true)
        
        let leftLegLower = skeleton?.childNode(withName: "mixamorig_LeftLeg", recursively: true)
        
        let leftLegUpper = skeleton?.childNode(withName: "mixamorig_LeftUpLeg", recursively: true)
        
        let rightLegLower = skeleton?.childNode(withName: "mixamorig_RightLeg", recursively: true)
        
        let rightLegUpper = skeleton?.childNode(withName: "mixamorig_RightUpLeg", recursively: true)
        
        let chest = skeleton?.childNode(withName: "mixamorig_Spine1", recursively: true)
        
        let leftFoot = skeleton?.childNode(withName: "mixamorig_LeftFoot", recursively: true)
        
        let rightFoot = skeleton?.childNode(withName: "mixamorig_RightFoot", recursively: true)
        
        
        
        
        var i = 1
        
        print(quaternionStrings)
        
        for transformInstance in quaternionStrings {
            let quaternionStringsList = transformInstance.components(separatedBy: ",")
            
            if i == 1 {
                
                leftHandLower?.simdWorldOrientation = simd_quatf(vector: simd_float4(
                    -Float(quaternionStringsList[0])!, Float(quaternionStringsList[1])!, Float(quaternionStringsList[2])!, -Float(quaternionStringsList[3])!
                ))
            }
            
            if i == 2 {
                leftHandUpper?.simdWorldOrientation = simd_quatf(vector: simd_float4(
                    -Float(quaternionStringsList[0])!, Float(quaternionStringsList[1])!, Float(quaternionStringsList[2])!, -Float(quaternionStringsList[3])!
                ))
            }
            
            if i == 3 {
                rightHandLower?.simdWorldOrientation = simd_quatf(vector: simd_float4(
                    -Float(quaternionStringsList[0])!, Float(quaternionStringsList[1])!, Float(quaternionStringsList[2])!, -Float(quaternionStringsList[3])!
                ))
            }
            
            if i == 4 {
                rightHandUpper?.simdWorldOrientation = simd_quatf(vector: simd_float4(
                    -Float(quaternionStringsList[0])!, Float(quaternionStringsList[1])!, Float(quaternionStringsList[2])!, -Float(quaternionStringsList[3])!
                ))
            }
            
            if i == 5 {
                waist?.simdWorldOrientation = simd_quatf(vector: simd_float4(
                    -Float(quaternionStringsList[0])!, Float(quaternionStringsList[1])!, Float(quaternionStringsList[2])!, -Float(quaternionStringsList[3])!
                ))
            }
            
            if i == 6 {
                leftLegLower?.simdWorldOrientation = simd_quatf(vector: simd_float4(
                    -Float(quaternionStringsList[0])!, Float(quaternionStringsList[1])!, Float(quaternionStringsList[2])!, -Float(quaternionStringsList[3])!
                ))
            }
            
            if i == 7 {
                leftLegUpper?.simdWorldOrientation = simd_quatf(vector: simd_float4(
