                ))
            }
            
            if i == 10 {
                chest?.simdWorldOrientation = simd_quatf(vector: simd_float4(
                    -Float(quaternionStringsList[0])!, Float(quaternionStringsList[1])!, Float(quaternionStringsList[2])!, -Float(quaternionStringsList[3])!
                ))
            }
            
            if i == 11 {
                leftFoot?.simdWorldOrientation = simd_quatf(vector: simd_float4(
                    -Float(quaternionStringsList[0])!, Float(quaternionStringsList[1])!, Float(quaternionStringsList[2])!, -Float(quaternionStringsList[3])!
